// components/NavBar.js

const navBarStyle = {
    backgroundColor: "red",
    color: "white",
    width: "100%",
    height: "60px"
  };
  
  const NavBar = () => (
    <div className="NavBar">
      NAVBAR

      <style jsx>{`
      background-color: red;
      color: white;
      width: 100%;
      height: 60px;
    `}</style>
    </div>
  );
  
  export default NavBar;
